import { Helmet } from 'react-helmet';
import ExListContainer from '../uk/container/ExListContainer';
import { Box, Container, Grid } from '@material-ui/core';

const UK = () => (
  <>
    <Helmet>
      <title>KDB Studio</title>
    </Helmet>
    <Box
      sx={{
        display: 'flex',
        backgroundColor: 'background.default',
        minHeight: '100%',
        paddingLeft: 10,
        py: 1,
      }}
    >
      <Box
        sx={{
          overflow: 'auto',
          boxShadow: 3,
        }}
      >
        <ExListContainer />
      </Box>
    </Box>
  </>
);

export default UK;
